import React from "react";
import './style.css';
import Mybtn from "./Button";

const App=()=>{
    return (
        <div>
            <h1 style={{textAlign:'center'}}>first react rendered</h1>
                <button className='btn'>App store</button>
                <Mybtn title="Play store"/>
                <Mybtn title="kirana store"/>
                <Mybtn title="unknown store"/>
                <Mybtn/>

        </div>
    )
}

export default App;
